import React, { useState } from 'react';
import styled from 'styled-components';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

import Header from './components/Header';
import Navigation from './components/Navigation';
import MultimodalAnalysis from './components/MultimodalAnalysis';
import QuestionAnswering from './components/QuestionAnswering';
import FewShotLearning from './components/FewShotLearning';
import PromptTemplates from './components/PromptTemplates';
import LoadingOverlay from './components/LoadingOverlay';

const AppContainer = styled.div`
  max-width: 1400px;
  margin: 0 auto;
  padding: 20px;
  min-height: 100vh;
`;

const ContentContainer = styled.div`
  background: rgba(255, 255, 255, 0.95);
  border-radius: 15px;
  padding: 30px;
  box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
  margin-top: 20px;
`;

function App() {
  const [activeTab, setActiveTab] = useState('multimodal');
  const [isLoading, setIsLoading] = useState(false);

  const renderActiveComponent = () => {
    switch (activeTab) {
      case 'multimodal':
        return <MultimodalAnalysis setIsLoading={setIsLoading} />;
      case 'qa':
        return <QuestionAnswering setIsLoading={setIsLoading} />;
      case 'few-shot':
        return <FewShotLearning setIsLoading={setIsLoading} />;
      case 'templates':
        return <PromptTemplates setIsLoading={setIsLoading} />;
      default:
        return <MultimodalAnalysis setIsLoading={setIsLoading} />;
    }
  };

  return (
    <AppContainer>
      <Header />
      <Navigation activeTab={activeTab} setActiveTab={setActiveTab} />
      <ContentContainer>
        {renderActiveComponent()}
      </ContentContainer>
      
      {isLoading && <LoadingOverlay />}
      
      <ToastContainer
        position="top-right"
        autoClose={5000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="light"
      />
    </AppContainer>
  );
}

export default App;
